import 'semantic-ui/dist/semantic.min.css';
import ButtonExampleButton from '../Btn';
import React from 'react';

const Home = () => {

    return (
        <div>
            <ButtonExampleButton /><button class="ui button" role="button">Btn with Semantic-UI</button>
        </div>
    )
}

export default Home;
